import React from 'react';
import './App.css';

import {Container, Row, Col} from 'react-bootstrap';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

import NavigationBar from './components/NavigationBar';
import Welcome from './components/Welcome';
import Footer from './components/Footer';
import AddCountryNumber from './components/AddCountryNumber';
import ListCountryNumbers from './components/ListCountryNumbers';


function App() {
  const marginTop={
    marginTop:"20px"
  };
  return (
    <Router>
        <NavigationBar/>
        <Container>
                    <Routes>
                        <Route path="/" exact component={Welcome}/>
                        <Route path="add" exact component={AddCountryNumber}/>
                        <Route path="list" exact component={ListCountryNumbers}/>
                    </Routes>
        </Container>
        <Footer/>
    </Router>
  );
}

export default App;
